window.bookSummaryJSON = "<p>Betrayal hurts worse at the hands of someone you love.</p> <p>I locked my heart up the night my wife was murdered.</p> <p>Now there is only one possessor of a key… my little girl.</p> <p>And that’s how I thought it would stay.</p> <p>Until my beautiful d’yavolitsa turns up covered in blood, begging for my help.</p> <p>She caught me off guard, preyed on my weakness, and set free my caged heart.</p> <p>Now she is mine to keep, cherish, and tear the world down for.</p> <p>Little did I realize, loving this woman would be the end of everything as I know it.</p> <p>The fate of our empire is in her hands.</p> <p>The secrets she keeps will shatter us both.</p> <p>Yet, not everything is always as it seems.</p> <p>When every card is stacked against us, we’re forced to play on the same team.</p> <p>In order to survive, we will burn together and unleash hell.</p> <p>That’s if I decide to let her live.</p> <p>Caged is book two of the series; it can, however, be enjoyed as a stand-alone.</p>"; 
